INSERT INTO `v1_986b5de36e916a91ab4b1efe8155d152764dc96eed43c78747e526b5413db679` VALUES (10, 0, 1, 0, 0, 72025, 1, "そしたらアオイさん、\n顔を真っ赤にして、ブンブン！　って、\n首を縦に振ってくれて。\nやった！　って思ったんですよね。", 11, 72, 1);
