INSERT INTO `v1_986b5de36e916a91ab4b1efe8155d152764dc96eed43c78747e526b5413db679` VALUES (10, 0, 1, 0, 0, 82013, 1, "その頃わたくしは、\nスカウトをお受けしておりました。\nミサト様いわく、わたくしには保育士の\n『天賦の才』があるそうで。", 11, 82, 1);
INSERT INTO `v1_986b5de36e916a91ab4b1efe8155d152764dc96eed43c78747e526b5413db679` VALUES (0, "", "", "", "", 82014, 0, "", 91, 82, 0);
